import React from "react";
import "./ShoppingCartPage.css";
import Details from "./Components/Details/Details";
import { Link } from "react-router-dom";
import CourseCard from "./Components/CourseCard/CourseCard";
import courseImg from "../../assets/course2.png";

export default function ShoppingCartPage() {
  const courses = [
    {
      title: "Introduction to User Experience Design",
      instructor: "John Doe",
      price: 45.0,
      rating: 4.6,
      ratingsCount: 250,
      courseDetails: "22 Total Hours. 155 Lectures. All levels",
    },
    {
      title: "Introduction to User Experience Design",
      instructor: "John Doe",
      price: 45.0,
      rating: 4.6,
      ratingsCount: 250,
      courseDetails: "22 Total Hours. 155 Lectures. All levels",
    },
    {
      title: "Introduction to User Experience Design",
      instructor: "John Doe",
      price: 45.0,
      rating: 4.6,
      ratingsCount: 250,
      courseDetails: "22 Total Hours. 155 Lectures. All levels",
    },
  ];

  return (
    <div className="container mt-5">
      <div className="content">
        <div className="shopping-cart-page">
          {/* 01 Header */}
          <div className="links">
            <Link className=" fs-2 fw-medium text-black me-4" to="">
              Shopping Cart
            </Link>
            <Link className="text-black me-4" to="">
              Categories
            </Link>
            <Link className="text-black me-4" to="">
              Details
            </Link>
            <Link className="shopping me-4" to="">
              Shopping Cart
            </Link>
          </div>
          <p className="my-4">{courses.length} Course(s) in cart</p>

          <div className="shopping-cart-body">
            {courses.map((course, index) => (
              <CourseCard key={index} course={course} courseImg={courseImg} />
            ))}
          </div>
        </div>
      </div>
      <div className="aside">
        <Details />
      </div>
    </div>
  );
}
